import { useEffect, useState } from "react";

const Chatbot = () => {
  const [chatData, setChatData] = useState(null);

  useEffect(() => {
    fetch("/data/Chatbot.json") // Make sure JSON is in public/data/
      .then((res) => res.json())
      .then((data) => setChatData(data))
      .catch((err) => console.error("Error loading chatbot JSON:", err));
  }, []);

  if (!chatData) return <div>Loading chatbot...</div>;

  return <div>Chatbot loaded successfully!</div>;
};

export default Chatbot;
